import React from 'react'

const Button_component =(props) => {
    console.log(props);
  return (
  <div className="c-filter-btn">
              <ul>
                <li className="active">
                  <a href="#">Toàn bộ kiến thức</a>
                </li>
                <li>
                  <a href="#">Dự án nhiều bình chọn</a>
                </li>
              </ul>
            </div>
  )
};

export default Button_component;
